function DateCard(props) {
	return (
		<>
            <div>{props.data}</div>
			<div>{props.toLocaleString('en-US', {year:'long'})}</div>
			<div>{props.toLocaleString('en-US', {day:'long'})}</div>
		</>
	);
}

export default DateCard;
